import { blog_data } from "../Assets/assets";
import { assets } from "../Assets/assets";
function Blogitem() {

    return (
        <>
        <div id = "blogitem-div">
        <div>
            <ul>
                <li>All</li>
                <li>Technology</li>
                <li>Startup</li>
                <li>Lifestyle</li>
            </ul>
        </div>
        <div id = "card-div">
            {blog_data}
        </div>
        </div>
        </>
    )
}

export default Blogitem;
